    false,nt"url": null,nt"notes": "The purposes of the terrestrial arthropod
    surveys are to: develop a species list of native and non-native terrestrial arthropods
    on land portions of the refuge; document basic environmental and ecological relationships
    for key species; assess potential threats posed by non-native species to the environment.
    Collecting this baseline information will be valuable in monitoring changes in the
    community, specifically detecting newly introduced species. Though species lists
    may include decapod crustaceans (terrestrial and intertidal crabs), the surveys
    focus on other arthropod groups, e.g., insects (Class Insecta), spiders (Class Arachnida),
    centipedes (Class Chilopoda), millipedes (Class Diplopoda), isopods (Class Malacostraca).
    Species distributions can be associated with micro-habitat preferences (e.g., host
    plant, substrate) to inform ecologically-based management plans by refuge staff.",nt"license_title":
